    return (
        <div>
            <Header/>
            <div className="flex justify-center flex-row-reverse">
            <div className="flex gap-x-4">
                <div>
                Check-in
                </div>
                <div>
                Check-out
                </div>
                <button className="bg-[#f07167] px-3 py-1 rounded-2xl text-white">
                Search
                </button>
            </div>
            <CustomerForm/>
            </div>
        </div>
    )
}
